  false,\n\t\"url\": null,\n\t\"notes\": \"Intensive surveys of waterbird use of the
  Patuxent Research Refuge have been conducted weekly since 1997. Originally surveys
  covered 53 wetland units encompassing approximately 560 acres, plus segments of
  the Patuxent and Little Patuxent Rivers. The amount of habitat has varied considerably
  over the years because of artificial drawdowns and drought. Most species rebounded
  from the low counts of 2003.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
